   const {id} = useParams(); 

   const[allvideos, setVideos] = useState([]);
   useEffect(()=>{
      fetchAllUsers();
   },[]);

   const fetchAllUsers = () => {
     // setVideos(id);
       // alert(id);
        console.log(id);
        var site = 'https://www.youtube.com/embed/'+id;
       // alert(site);
        document.getElementById('youtubevideos').src = site;
  }
return (
<div>
   <section className="masthead">
      <div className="container">
